import './App.css';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Products from './Components/Pages/Products/Products';
import Home from './Components/Pages/Home/Home';
import About from './Components/Pages/About/About';
import Contact from './Components/Pages/Contact/Contact';
import "./index.css"
import GuitarShirt from './Components/Pages/ProductItems/GuitarShirt';
import ColoredShirt from './Components/Pages/ProductItems/ColoredShirt';
import Dress from './Components/Pages/ProductItems/Dress';
import Bag from './Components/Pages/ProductItems/Bag';
import Hat from './Components/Pages/ProductItems/Hat';
import Coat from './Components/Pages/ProductItems/Coat';
import Register from './Components/Pages/Register/Register';
import Login from './Components/Pages/Login/Login';
import Cart from './Components/Pages/Cart/Cart';
import Pay from './Components/Pages/Payment/Pay';
import Success from './Components/Pages/Payment/Success';


const App = () => {
  const user = true;
    return (
        <Router>
          <div className = "app">
            <div className = "pages">
    
              <Routes>
                <Route path = "/" element = {<Home/>}/>
                <Route path = "/products/:cateogry" element = {<Products/>}/>
                <Route path = "/product/:id" element = {item.component}/>
                <Route path = "/about" element = {<About/>}/>
                <Route path = "/contact" element = {<Contact/>}/>
                <Route path = "/cart" element = {<Cart/>}/>
                <Route path = "/register" element = { user ? <Navigate to ="/"/> : <Register/>}/>
                <Route path = "/login" element = { user ? <Navigate to ="/"/> : <Login/>}/>
                <Route path = "/pay" element = {<Pay/>}/>
                <Route path = "/Success" element = {<Success/>}/>
              </Routes>

              <Routes>
                <Route path = "/product/GuitarShirt" element = {<GuitarShirt/>}/>
                <Route path = "/product/ColoredShirt" element = {<ColoredShirt/>}/>
                <Route path = "/product/Dress" element = {<Dress/>}/>
                <Route path = "/product/Bag" element = {<Bag/>}/>
                <Route path = "/product/Hat" element = {<Hat/>}/>
                <Route path = "/product/Coat" element = {<Coat/>}/>
              </Routes>
    
            </div>
          </div>
        </Router>
    );
}

export default App;
